const TableComponent = ({ data }) => {
    return (
        <table style={{ width: '100%', borderCollapse: 'collapse', margin: '20px 0' }}>
            <thead>
                <tr>
                    <th style={{ border: '1px solid #ddd', padding: '8px' }}>Column 1</th>
                    <th style={{ border: '1px solid #ddd', padding: '8px' }}>Column 2</th>
                    {/* 更多列头根据需求添加 */}
                </tr>
            </thead>
            <tbody>
                {/* 无数据时依然显示空表格结构 */}
                {data.length === 0 ? (
                    <tr>
                        <td style={{ border: '1px solid #ddd', padding: '8px' }} colSpan="2"></td> {/* 空行 */}
                    </tr>
                ) : (
                    data.map((row, index) => (
                        <tr key={index}>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column1}</td>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column2}</td>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column1}</td>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column2}</td>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column1}</td>
                            <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.column2}</td>
                            {/* 更多列的数据 */}
                        </tr>
                    ))
                )}
            </tbody>
        </table>
    );
};

export default TableComponent;
